import React from "react";
import s from './Navbar.module.css'
import {Link} from 'react-router-dom'


const Navbar=()=>{
    return (
        <div className={s.fill}>
         <ul className={s.nnav}>
        <Link>Red</Link>
        <Link>Green</Link>
        
      </ul></div>
    
)
    
    
 
}

export default Navbar;
